import React from 'react';

function Home() {
  return (
    <div className="container mx-auto p-4">
      <h1 className="text-3xl font-bold mb-4">Bienvenido a Mi Plataforma de Cursos</h1>
      <p className="text-lg">Explora nuestros cursos y comienza a aprender hoy mismo.</p>
    </div>
  );
}

export default Home;
